import React from 'react';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import useMediaQuery from '@material-ui/core/useMediaQuery';
import HeaderMenu from './Header/HeaderMenu'
import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';

import ArrowDropDownCircleOutlinedIcon from '@material-ui/icons/ArrowDropDownCircleOutlined';


import GoogleAuth from './GoogleAuth'

 const Header = () => {
  const matches = useMediaQuery('(max-width:500px)');

    const RenderButtons = () =>{
        return (
            <>
             <Button color="inherit">Streams</Button>
             <GoogleAuth />
            </>
        )
    }

    const RenderMenu = () =>{
        const [anchorEl, setAnchorEl] = React.useState(null);

        const handleClick = (event) => {
        setAnchorEl(event.currentTarget);
        };

        const handleClose = () => {
        setAnchorEl(null);
        };

  return (
    <div >
      <Button aria-controls="simple-menu" aria-haspopup="true" onClick={handleClick}>
        <ArrowDropDownCircleOutlinedIcon className="dropdown_Menu"/>
      </Button>
      <Menu
        id="simple-menu"
        anchorEl={anchorEl}
        keepMounted
        open={Boolean(anchorEl)}
        onClose={handleClose}
      >
        <MenuItem onClick={handleClose}>
            <Button color="inherit">Streams</Button>
        </MenuItem>
        <MenuItem onClick={handleClose}>
            <GoogleAuth />
        </MenuItem>
      </Menu>
    </div>
  );
}

  return (
    <div>
      <AppBar style={{backgroundColor: '#28b5b5'}} position="static">
        <Toolbar>
            <HeaderMenu />
          <Typography variant="h6" className="header_title">
            StreamShow
          </Typography>
          {matches ? <RenderMenu /> : <RenderButtons />}
        </Toolbar>
      </AppBar>
    </div>
  );
}

export default Header
